import React from 'react';
import CardList from './CardList';
import SearchBox from './SearchBox';
import { robots } from './Robots';


class App extends React.Component {
	constructor () { 
		super ()
		this.state = {
			robots: robots,
			searchfield: '',
		}
	}
	render() {
		return (
			<div className='tc'>
				<h1> RoboFriends </h1>
				<SearchBox />
				<CardList robots={ this.state.robot }/>
			</div>
		);
	}
}

export default App;
